A few of yall requested my current skincare routine! ✨ PLEASE NOTE: good skin starts within! my skin is a result of the condition of my hormones, my diet, my stress levels, and overall how I care for my body. I’ve been breaking out a lot lately, particularly in the same areas due to hormonal shifts now that my cycle is back regular and I’ve stopped breastfeeding. while skincare is great for assisting with the condition of my skin, the real work is done internally! 

Products mentioned:
